import React from 'react';
import mezel from "./images/butchering.png";

function ButtonBox({ image, onClick }) {
  return (
    <div className="button-box" onClick={onClick}>
      <img src={image} alt="Button" className="button-image" />
    </div>
  );
}

function Categorii() {
  const handleClick = (event) => {
    // Handle button click event here
    console.log('Button clicked!');
  };

  return (
    <>
      <button>
        <img src={mezel} alt="" className="img-fluid" style={{ height: "190px", width: "100%", objectFit: "cover" }} />
      </button>

      <div className="button-row">
        <ButtonBox image="path/to/svg1.svg" onClick={handleClick} />
        <ButtonBox image="path/to/svg2.svg" onClick={handleClick} />
        <ButtonBox image="path/to/svg3.svg" onClick={handleClick} />
        {/* Add more ButtonBox components as needed */}
      </div>
    </>
  );
}

export default Categorii;
